import React, { FunctionComponent } from 'react';
import SkinList from './skin-list';

const UserProfile: FunctionComponent = () => {


    return (
        <div className='user-page  flex-start-x flex-center-y flex-row p50 pb0'>
            <div className="flex-col w20">
                <div className='flex-center flex-col'>
                    <img src="https://media.discordapp.net/attachments/967347575390863360/1097526768572846110/pict_profile.png?width=671&height=671" alt="" width={"50%"} height={"50%"} />
                    <h2>pseudo</h2>
                </div>
            </div>
            <div className="flex-col w60 flex-center-x flex-start-y" >


                <div className='flex-row w100 flex-around h10'>
                    <h2 className='upper'>Skins creation</h2>
                    <h2 className='upper'>Skins liked</h2>
                </div>
                <div className="w100 h90">
                    <SkinList />
                </div>

            </div>
        </div>
    );
}

export default UserProfile;
